import React from 'react'

const Post = React.forwardRef(({ post }, ref) => {
    const displayData = post.map(
        (info)=> {
          return(
            <tr>
              <td>{info.resteraunt}</td>
              <td>{info.name}</td>
              <td>{info.people}</td>
              <td>{info.timetag}</td>
            </tr>
          )
        }
      )

    const content = ref
        ? <article ref={ref}>{displayData}</article>
        : <article>{displayData}</article>

    return content



})

export default Post
